//CC     PROC M=,
//* COMPILE C++ PROGRAM WITH DEBUG
//* M  = MODULE NAME
//   CRUN=,                               < COMPILER RUNTIME OPTIONS
//   CPARM='SOURCE',
//   CREGSIZ='48M',                       < COMPILER REGION SIZE
//   LIBPRFX='CEE',                       < PREFIX FOR LIBRARY DSN
