//*-------------------------------------------------------------------
//*  COMPILE STEP:
//*-------------------------------------------------------------------
//COMPILE EXEC PGM=CCNDRVR,REGION=&CREGSIZ,
//    PARM=('&CRUN/&CPARM OPTFILE(DD:OPTFILE)')
//STEPLIB  DD  DSN=&LIBPRFX..SCEERUN,DISP=SHR
//         DD  DSN=CBC.SCCNCMP,DISP=SHR
//USERLIB  DD  DISP=SHR,DSN=ESA.PRJ.CBTEXP.HPP
